INSERT INTO `parques` (`id`, `nombre`, `imagen`, `ubicacion`, `descripcion`) VALUES
	(6, 'Parque Juan Montalvo', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3988.8805968376328!2d-78.6340797!3d-1.2422442!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381be8f60b16d%3A0x8b93263144e48b41!2sParque%20Montalvo!5e0!3m2!1ses!2sec!4v1707238880728!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Rinde homenaje al ilustre escritor Juan Montalvo. Este parque es un espacio tranquilo con jardines bien cuidados, estatuas y un ambiente relajado.'),
	(7, 'Parque Cevallos', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.882143305062!2d-78.6269361!3d-1.2412194!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381bc6b1f4f69%3A0x46074aa4ede3ab5d!2sParque%20Cevallos!5e0!3m2!1ses!2sec!4v1707244909566!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Es conocido por sus amplias áreas verdes, juegos infantiles y zonas de descanso. Es un lugar frecuentado por familias y personas que buscan un espacio al aire libre.'),
	(8, 'Parque Provincial de la Familia', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.874487568977!2d-78.6587835!3d-1.2462844!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d37f5e242987e1%3A0x72f2e31209aa59b7!2sParque%20Provincial%20de%20la%20Familia!5e0!3m2!1ses!2sec!4v1707246069039!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Diseñado para el entretenimiento familiar, este parque puede tener instalaciones recreativas, áreas de juegos para niños y lugares para hacer picnic.'),
	(9, 'Parque 12 de noviembre', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.8794520108513!2d-78.62657449999999!3d-1.2430023!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381bdb02f4a85%3A0x2b3ef69771067022!2sParque%2012%20de%20Noviembre!5e0!3m2!1ses!2sec!4v1707246166145!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Puede contar con áreas deportivas, fuentes decorativas y espacios abiertos para actividades recreativas. Es un lugar donde los residentes disfrutan de diversas actividades al aire libre.');
INSERT INTO `parques` (`id`, `nombre`, `imagen`, `ubicacion`, `descripcion`) VALUES
	(11, 'Parque de los enamorados', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.872356269091!2d-78.6283836!3d-1.2476908!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d38196824fd749%3A0x5362de7d609d39ab!2sParque%20de%20los%20Enamorados!5e0!3m2!1ses!2sec!4v1707246334069!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Atractivo turístico de Ambato perfecto para conocer. Una representación del arte verde, el parque de los enamorados se encuentra ubicado en Bellavista justo al frente del parque Juan Benigno Vela');

