INSERT INTO `restaurantes` (`id`, `nombre`, `imagen`, `ubicacion`, `descripcion`) VALUES
	(1, ' La Casona del Molino', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d7977.765238016111!2d-78.6314807863133!3d-1.240903994968183!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1sAv.%20Bolivariana%20y%20Belisario%20Torres%2C%20Ambato.!5e0!3m2!1ses!2sec!4v1707448024881!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Ofrece una variedad de platos tradicionales ecuatorianos en un ambiente acogedor y familiar. Destaca por sus deliciosas empanadas de viento y su cuy asado.'),
	(2, 'La Fornace', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7977.765238046319!2d-78.63150224495239!3d-1.2409039849462935!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x91d381ba9966473b%3A0x7608fe8af5d21ceb!2sMultifamiliares%2012%20de%20Noviembre!5e0!3m2!1ses!2sec!4v1707448055385!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Especializado en cocina italiana, La Fornace ofrece auténticas pizzas horneadas en horno de leña, pastas frescas y antipastos. Ideal para una cena romántica o familiar.'),
	(3, 'Mi Granja Linda', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d63821.11862744246!2d-78.62640349909668!3d-1.281810267339797!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1sUbicaci%C3%B3n%3A%20Km%201.5%20v%C3%ADa%20a%20Pelileo%2C%20Ambato.!5e0!3m2!1ses!2sec!4v1707448088001!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Con un ambiente campestre y acogedor, Mi Granja Linda sirve platos típicos ecuatorianos, destacando sus carnes a la parrilla y su variedad de platos a base de trucha fresca.'),
	(5, 'El Troje', _binary , '<iframe src="https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d15955.41465206741!2d-78.61996095499143!3d-1.2599588295637065!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1sAv.%20Bolivariana%20y%20Victor%20Hugo%20Ponce%2C%20Ambato.!5e0!3m2!1ses!2sec!4v1707448134575!5m2!1ses!2sec" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>', 'Con una decoración rústica y ambiente cálido, El Troje es famoso por su amplio menú de comida típica ecuatoriana, así como por sus parrilladas y platos de mariscos frescos.');

